import myimg from '../src/images/myimg.jpg';
import {NavLink} from 'react-router-dom';




function Services() {
  return (
        <> 
        <Navbar/>
        <div className="my-5">
             <h2 className="text-center">Our Services</h2>
        </div>
        <div className="container-fluid mb-3">
           <div className="row">
              <div className="col-10 mx-auto">
                <div className="row gy-4">
              



